import ReactImage from 'react-image-wrapper'



const Finance = () => {
    
    
    
    
    return (
        <div className="finance-title">
            <h3>Finance</h3>
            <div className="finance-image">
              <ReactImage 
                src="./financeicon.png"
                width={30}
                height={30}
                title="Finance"
           />
            </div>
        </div>
      );
}
 
export default Finance;
